INSERT INTO `products` (`id`, `name`, `description`, `price`, `category_id`, `created`, `updated`) VALUES
(1105180041, 'Nike Precision Jr.', '<p><b class=\"u-bold\">STABILITY FOR THE COURSE</b></p><br><p>the Nike Precision Jr. Kids\' Golf Shoe features full-length foam cushioning for lightweight comfort and a stable feel at the course and range. Its outsole has an Integrated Traction pattern for enhanced grip on a variety of surfaces.</p><br><p><b class=\"u-bold\">Benefits</b></p><li>Synthetic leather upper is water-resistant</li><li>Integrated traction pattern enhances grip</li><li>Full-length foam cushioning for lightweight comfort</li><li>Inner sleeve for a sock-like feel</li><li>Rubber outsole for durability</li><li>Shown: White/Metallic Silver/Black</li><li>Style: 909251-100</li>', '70', 201808, '2018-05-12 00:09:10', '2018-05-11 17:09:10'),
(1105180042, 'Nike Roshe Jr.', '<p><b class=\"u-bold\">ICONIC AND COMFORTABLE</b></p><br><p>Inspired by an icon, the Nike Roshe Jr. Little/Big Kids\' Golf Shoe features a pressure-mapped outsole that provides traction in key zones. The mesh upper offers breathability and a modern look, while the soft, flexible foam midsole cushions every step.&nbsp;</p><br><p><b class=\"u-bold\">Benefits</b></p><li>Outsole provides strategically placed traction and support</li><li>Lightweight mesh provides breathable comfort</li><li>Foam midsole for ultra-soft cushioning</li><li>Heel and pull tabs for easy on and off</li><li>Heel counter stabilizes your foot during your swing</li><li>Shown: Black/White</li><li>Style: 909250-001</li>', '60', 201808, '2018-05-12 00:09:10', '2018-05-11 17:09:10'),
(1105180071, 'Nike Epic React Flyknit', '<p><b class=\"u-bold\">COMFORT THAT NEVER ENDS</b></p><br><p>From big races to everyday practice, the Nike Epic React Flyknit Big Kids\' Running Shoe delivers crazy comfort that lasts as long as you can run. Its Nike React foam cushioning is springy but lightweight, durable but soft, for an “Instant Go” feel that helps make running more fun.</p><br><p><b class=\"u-bold\">Ridiculously Responsive </b></p><p>Nike React foam is incredibly springy, with 13% more bounce than Nike Lunarlon. The more energy you put into your step, the more energy you get in return.</p><br><p><b class=\"u-bold\">Feels Like the First Run </b></p><p>Whether you’re running on the track or in your neighborhood, Nike React foam is designed to keep its shape and feel, run after run. In our tests, champion runners like Galen Rupp said the shoe\'s cushioning still felt “like new” after 300 miles.</p><br><p><b class=\"u-bold\">Give Your Feet a Hug </b></p><p>Nike Flyknit hugs your foot, for a snug, seamless feel from heel to toe, incredible breathability and an unmistakable look.</p><br><p><b class=\"u-bold\">More Details</b></p><li>Oversized pull tab for easy on and off</li><li>Rubber on the toe and heel for durability</li><li>Precisely placed traction grips the ground</li><li>Heel cage helps keep your foot from rocking when you run</li><li>Shown: White/Pure Platinum/University Red</li><li>Style: 943311-106</li><br><p><b class=\"u-bold\">Flyknit Origins </b></p><p>Nike Flyknit technology was inspired by feedback from runners seeking a shoe with the snug (and virtually unnoticed) fit of a sock. Nike embarked on a four-year mission with teams of programmers, engineers and designers to create the technology needed to make the knit upper with static properties for structure and durability. Then the precise placement of support, flexibility and breathability—all in one layer—was refined. The result is a featherweight, formfitting and virtually seamless upper. This unprecedented precision maximizes performance while reducing the material waste of traditional cut and sew by an average of 60%. The equivalent of six recycled plastic bottles are used in every pair of Flyknit shoes, saving millions of pounds of material from reaching landfills.</p><br><p><b class=\"u-bold\">Nike Epic React Frequently Asked Questions</b></p><p><br></p><br><p><b class=\"u-bold\">What are the main performance benefits of this shoe?</b></p><p>The Nike Epic React Flyknit combines Nike React foam midsole with a Nike Flyknit upper to deliver a lightweight, soft yet responsive ride mile after mile. Nike React foam gives 13% greater energy return than Nike Lunar foam, while still delivering a soft and snappy ride. As a direct comparison to the Nike LunarEpic Flyknit 2, the Nike Epic React Flyknit is 5% lighter, 11% softer and provides 10% more energy return.</p><br><p><b class=\"u-bold\">What is Nike React?</b></p><p>Nike React foam was developed in-house and the unique composition gives runners foam that is lighter, softer, more responsive and even more durable than Nike Lunar foam. Historically, these four elements have been solved for individually and it was difficult to deliver them in one package. However, Nike React technology delivers them in one.</p><br><p><b class=\"u-bold\">How durable is this shoe?</b></p><p>Nike React was built to last for many miles. Nike React technology is a proprietary foam that is more responsive and more durable than Nike Lunar foam. We know from our testing that the more foam and less rubber protection on the outsole of the shoe, the better the experience of React. So, we purposely went as minimal as possible with rubber coverage. We did see and experience in our testing some wear and tear on the outsole foam, but we believe the benefit of the minimal outsole coverage outweighs the visible wear of the foam. And our testers said although it may wear visibly, there is no perceived degradation to the running experience.</p><br><p><b class=\"u-bold\">Does Nike Epic React fit to size?</b></p><p>Flyknit material conforms to the shape of your foot, creating a snug, hug-like feel that fits true to size. If you prefer a slightly looser fit, we recommend ordering a ½ size up</p><br><p><b class=\"u-bold\">Is Nike React made from EVA?</b></p><p>No. The primary ingredient in Nike React foam is a synthetic rubber. The foam is proprietary to Nike – you won’t find it anywhere else.</p><br><p><b class=\"u-bold\">How long was the development process?</b></p><p>It took over 400 different combinations of chemistry and processing to land the unique composition of the Nike React foam midsole. In addition, we have undertaken 17,000 miles of testing with some of our elite runners and also everyday runners.</p><br><p><b class=\"u-bold\">Was testing only undertaken in the US or was it undertaken in other countries as well?</b></p><p>Testing was undertaken globally – not just in the US. It is important to test in all conditions and surfaces to ensure it delivers the best performance for the runner.</p><br><p><b class=\"u-bold\">Which athletes have been involved in the development process?</b></p><p>We have undertaken 17,000 miles of testing with some of our elite runners and also everyday runners. Some of the elite runners include Eliud Kipchoge, Galen Rupp, Evan Jager, Emily Infield and Colleen Quigley.</p><br><p><b class=\"u-bold\">What’s the difference between Nike React and Nike ZoomX?</b></p><p>Nike React technology and Nike ZoomX midsole cushioning are both light, soft and responsive. Specifically designed for speed, Nike ZoomX delivers our greatest energy return in our fastest line of Running footwear. Nike React foam offers a combination of four key benefits – softness, responsiveness, lightness and long-lasting durability in one single offering.</p><br>', '145', 201802, '2018-05-12 06:19:30', '2018-05-11 23:19:30'),
(1105180072, 'Nike Air Max Sequent 3', '<p><b class=\"u-bold\">SMOOTH STEP</b></p><br><p>The Nike Air Max Sequent 3 Big Kids\' Running Shoe combines a Max Air unit in the heel, soft foam cushioning and grooves on the sole for a smooth heel-to-toe step.</p><br><p><b class=\"u-bold\">Benefits</b></p><li>U-shaped Max Air unit mirrors the shape of your heel for a cushioned feel</li><li>Mesh material for lightweight breathability</li><li>Grooves along the sole let your foot flex naturally</li><li>Foam cushioning for comfort</li><li>Shown: Game Royal/Pure Platinum/Metallic Silver/Game Royal</li><li>Style: 922884-401</li><br><p><b class=\"u-bold\">NIKE AIR MAX ORIGINS </b></p>Nike\'s revolutionary Air-Sole unit made its way into Nike footwear in 1978. In 1987, the Nike Air Max 1 debuted with visible air in its heel, allowing fans more than just the feel of Air-Sole comfort—suddenly they could see it. Since then, next-generation Nike Air Max shoes have become a hit with athletes and collectors by offering striking color combinations and reliable, lightweight cushioning.', '80', 201802, '2018-05-12 06:19:30', '2018-05-11 23:19:30'),
(1105180073, 'Nike LunarSolo', '<p><b class=\"u-bold\">SMOOTH SPEED</b></p><br><p>The Nike&nbsp;LunarSolo&nbsp;Big Kids\' Running Shoe is designed to evenly disperse impact along your foot to keep your legs fresh for everyday runs and the next big race.</p><br><p><b class=\"u-bold\">Benefits</b></p><li>Textile upper for breathable support</li><li>Ultralight, springy Lunarlon cushioning for soft yet responsive shock absorption</li><li>Engineered sole helps evenly disperse impact along your foot</li><li>Foam cushioning flexes with your foot for comfortable movement</li><li>Seamless overlays provide a streamlined look</li><li>Shown: Black/Black/White/Black</li><li>Style: AA4403-001</li>', '70', 201802, '2018-05-12 06:19:30', '2018-05-11 23:19:30'),
(1105180074, 'Nike Air VaporMax', '<p><b class=\"u-bold\">AIR TO MOVE YOU FORWARD</b></p><br><p>With a reinvented cushioning system, the Nike Air VaporMax Big Kids\' Running Shoe delivers a lightweight, bouncy ride for a gravity-defying sensation underfoot and engineered mesh fabric for stretchy, comfortable support.</p><br><p><b class=\"u-bold\">LIGHTWEIGHT CUSHIONING </b></p><p>Air cushioning provides maximum impact protection from heel to toe. Carved-out sections of the sole help keep the shoe incredibly flexible and lightweight.</p><br><p><b class=\"u-bold\">FLAWLESS FIT </b></p><p>Engineered mesh stretches with and supports your foot for lightweight, breathable comfort.</p><br><p><b class=\"u-bold\">MORE DETAILS</b></p><li>Heel overlay adds structure for a stable feel</li><li>Rubber pods on the sole for durability</li><li>Foam padding around the collar and heel for added comfort</li><li>Shown: Wolf Grey/Metallic Silver/Anthracite/Light Carbon</li><li>Style: 917963-006</li><br><p><b class=\"u-bold\">BEHIND THE DESIGN </b></p><p>The Air VaporMax represents a new era in Nike innovation. “It’s changed our whole philosophy on how we design for Air,” says Cushioning Innovation Designer Zachary Elder. With the VaporMax, the designers wanted to truly capture the feeling of ‘running on air.’ The designers started by restructuring the Air unit so they could attach it directly to the upper. “That was the biggest challenge,” says Tom Minami, Senior Footwear Designer – but it was worth it. “Without any midsole or sockliner, you get to feel the Air in a whole new way.” In previous Air Max models, the goal was to fill the sole with as much Air as possible, but with the VaporMax, the focus is on using the Air efficiently. “As you step down, each lug gets pushed into the Air unit, ramping up the pressure,” Elder explains. “As you step off, the pressure releases, creating that springy bounce.” After the seven-year journey from ideation to release, Elder and Minami are excited for what’s to come. “I’m super proud of the product,\" Elder says. “This new approach is going to be a huge turning point for Air – and for Nike.”</p><br><p><b class=\"u-bold\">NIKE AIR MAX ORIGINS </b></p><p>Nike\'s revolutionary Air-Sole unit made its way into Nike footwear in 1978. In 1987, the Nike Air Max 1 debuted with visible air in its heel, allowing fans more than just the feel of Air-Sole comfort—suddenly they could see it. Since then, next-generation Nike Air Max shoes have become a hit with athletes and collectors by offering striking color combinations and reliable, lightweight cushioning.</p><br>', '155', 201802, '2018-05-12 06:19:30', '2018-05-11 23:19:30'),
(1105180075, 'Nike Free RN 2018', '<p><b class=\"u-bold\">FLEX YOUR FAST</b></p><br><p>The Nike Free RN 2018 Big Kids\' Running Shoe is as flexible as ever. Its updated Nike Free midsole adjusts to your every step, whether you\'re jogging or sprinting, providing balanced support and lightweight cushioning where and when you need it.</p><br><p><b class=\"u-bold\">Benefits</b></p><li>One-piece mesh upper for breathability and snug comfort</li><li>Flywire cables integrate with the laces for lightweight support</li><li>Nike Free midsole provides flexible, all-day comfort</li><li>Rounded heel rolls with the ground to enable natural range of motion</li><li>Padded collar and stretchy heel strap support the back of your foot</li><li>Shown: Noise Aqua/Igloo/Pure Platinum/White</li><li>Style: AH3457-401</li><br><p><b class=\"u-bold\">Nike Free Origins</b></p><p>After learning that Stanford athletes had been training barefoot, three of Nike\'s most innovative and creative employees set out to develop a shoe that felt natural and weightless, similar to bare feet. The team spent four years studying the biomechanics of runners\' feet in motion. The results yielded a profound understanding of the foot\'s natural landing angle, pressure and toe position, allowing Nike designers to build an unconventional and flexible running shoe from the inside out.</p><br>', '80', 201802, '2018-05-12 06:19:30', '2018-05-11 23:19:30'),
(1105180076, 'Nike Revolution 4', '<p><b class=\"u-bold\">MINIMAL DESIGN, MAXIMUM COMFORT.</b></p><br><p>The Nike Revolution 4 Big Kids\' Running Shoe combines lightweight cushioning and a minimal design for streamlined speed and lasting comfort.</p><br><p><b class=\"u-bold\">Benefits</b></p><li>Mesh for breathable comfort</li><li>Soft foam provides lightweight cushioning</li><li>Flex grooves along the sole let your foot flex naturally</li><li>Rubber outsole for durable stability</li><li>Shown: Gym Red/Team Red/Black/White</li><li>Style: 943309-601</li>', '58', 201802, '2018-05-12 06:19:30', '2018-05-11 23:19:30'),
(1105180077, 'Jordan Grind', '<p><b class=\"u-bold\">PREMIUM LOOK. COMFORTABLE SUPPORT.</b></p><br><p>The Jordan Grind Big Kids\' Training Shoe features signature Jordan details and delivers comfortable, responsive cushioning with Lunarlon foam.</p><br><p><b class=\"u-bold\">Benefits</b></p><li>Mesh or suede construction for comfortable support</li><li>Synthetic overlays stabilize your foot</li><li>TPU straps integrate with laces for a locked-down feel</li><li>Ultralight, springy Lunarlon cushioning for soft yet responsive shock absorption</li><li>Heel pull tab for easy on and off</li><li>Shown: Black/White/Metallic Gold</li><li>Style: AH4375-031</li>', '90', 201802, '2018-05-12 06:19:30', '2018-05-11 23:19:30'),
(1105180078, 'Nike Revolution 3', '<p><b class=\"u-bold\">CUSHIONED SUPPORT IN MOTION</b></p><br><p>The Nike Revolution 3 Infant/Toddler Shoe&nbsp;has a lightweight mesh upper with&nbsp;no-sew overlays for a breathable, supportive feel. A rubber cupsole provides low-profile support, traction and comfort.</p><br><p><b class=\"u-bold\">Benefits</b></p><li>Mesh upper has no-sew overlays for a snug, breathable fit</li><li>Rubber cupsole provides flexible traction</li><li>Hook-and-loop closure for a locked-in feel</li><li>Shown: University Red/Black/White/Metallic Silver</li><li>Style: 819415-600</li>', '45', 201802, '2018-05-12 06:19:30', '2018-05-11 23:19:30'),
(1105180079, 'Nike Revolution 4 FlyEase', '<p><b class=\"u-bold\">EASY COMFORT</b></p><br><p>The Nike Revolution 4 FlyEase&nbsp;Big Kids\' Running Shoe combines ultra-soft foam cushioning with lightweight mesh all-day comfort. The lace-free FlyEase closure system connects a hook-and-loop strap to a wraparound zipper so you can open and close the shoe – heel and all – in one fluid motion.</p><br><p><b class=\"u-bold\">Benefits</b></p><li>Nike FlyEase system provides wraparound support and easy on and off</li><li>Mesh provides breathable comfort</li><li>Lightweight foam cushions your foot&nbsp;</li><li>Rubber sole for excellent traction and stability</li><li>Flex grooves along the sole helps&nbsp;your foot flex naturally</li><li>Shown: Black/Anthracite/Total Crimson/White</li><li>Style: AH8797-001</li>', '58', 201802, '2018-05-12 06:19:30', '2018-05-11 23:19:30'),
(1105180080, 'Nike LunarEpic Low Flyknit 2', '<p><b class=\"u-bold\">START FAST, FINISH STRONG.</b></p><br><p>Perfect for distance running, the Nike LunarEpic Low Flyknit 2 Big Kids\' Running Shoe hugs your foot with lightweight Flyknit and cushions your ride with responsive Lunarlon foam.</p><br><p><b class=\"u-bold\">Sock-Like Fit</b></p><p>A near-seamless Flyknit upper wraps your foot from heel to toe, offering support, flexibility and breathability where you need them most.</p><br><p><b class=\"u-bold\">Springy Cushioning</b></p><p>Lunarlon cushioning is springy and plush—perfect for long-distance runs or all-day comfort.</p><br><p><b class=\"u-bold\">Responsive Step</b></p><p>Unique pods on the sole collapse and spring back with every stride, providing a fluid ride and excellent traction.</p><br><p><b class=\"u-bold\">More Details</b></p><li>Flywire cables connect with the laces to lock your foot in</li><li>Heel overlay adds support</li><li>Shown: Black/Anthracite/White</li><li>Style: 869990-001</li><br><p><b class=\"u-bold\">FLYKNIT ORIGINS</b></p>Nike Flyknit technology was inspired by feedback from runners seeking a shoe with the snug (and virtually unnoticed) fit of a sock. Nike embarked on a four-year mission with teams of programmers, engineers and designers to create the technology needed to make the knit upper with static properties for structure and durability. Then the precise placement of support, flexibility and breathability—all in one layer—was refined. The result is a featherweight, formfitting and virtually seamless upper. This unprecedented precision maximizes performance while reducing the material waste of traditional cut and sew by an average of 60%. The equivalent of six recycled plastic bottles are used in every pair of Flyknit shoes, saving millions of pounds of material from reaching landfills.', '115', 201802, '2018-05-12 06:19:30', '2018-05-11 23:19:30'),
(1105180081, 'Nike Flex Contact', '<p><b class=\"u-bold\">COMFORT ON THE GO</b></p><br><p>The Nike Flex Contact Big Kids\' Running Shoe is made with stretchy material that lets your foot move naturally for comfort on the go.</p><br><p><b class=\"u-bold\">Benefits</b></p><li>Knit material allows natural flexibility</li><li>Foam cushioning for all-day comfort</li><li>Grooves let the shoe expand and contract with every step</li><li>Shown: Racer Blue/White/Black</li><li>Style: 917932-402</li>', '65', 201802, '2018-05-12 06:19:30', '2018-05-11 23:19:30'),
(1105180082, 'Nike Zoom Pegasus 34 FlyEase', '<p><b class=\"u-bold\">MYTHIC SPEED</b></p><br><p>The Nike Zoom Pegasus 34 FlyEase Big Kids\' Running Shoe features a mesh upper and Nike Zoom Air unit for lightweight speed as well as Flywire cables to lockdown your midfoot for extended comfort on the track.</p><br><p><b class=\"u-bold\">Benefits</b></p><li>Nike Zoom Air cushioning for lightweight responsiveness</li><li>Mesh upper provides breathable comfort</li><li>Flywire cables offer lightweight support when and where you need it</li><li>Nike FlyEase system provides wraparound support and easy on and off</li><li>Shown: Mica Blue/Racer Pink/Sport Fuchsia/Black</li><li>Style: 918022-400</li>', '90', 201802, '2018-05-12 06:19:30', '2018-05-11 23:19:30'),
(1105180083, 'Nike Revolution 4 Fade', '<p><b class=\"u-bold\">BREATHABLE COMFORT AND SUPPORT</b></p><br><p>The Nike Revolution 4 Fade&nbsp;Little Kids\' Shoe wraps growing feet in comfortable mesh, and softens every step with foam cushioning. A&nbsp;hook-and-loop strap helps&nbsp;stabilize feet and makes the shoe easy to take on and off.</p><br><p><b class=\"u-bold\">Benefits</b></p><li>Mesh wraps your foot for breathable support</li><li>Lightweight foam cushioning for all-day comfort</li><li>Synthetic leather hook-and-loop strap for a locked-in feel</li><li>Rubber tread sections for durable traction</li><li>Shown: Black/Volt/Black/Total Orange</li><li>Style: AR2420-001</li>', '52', 201802, '2018-05-12 06:19:30', '2018-05-11 23:19:30'),
(1105180084, 'Nike Free RN Flyknit 2017', '<p><b class=\"u-bold\">BREATHABLE, FLEXIBLE, FAST.</b></p><br><p>The Nike Free RN Flyknit 2017&nbsp;Big Kids\' Running Shoe combines the ultralight, snug fit of Nike Flyknit with the incredible flexibility of a Nike Free sole.</p><br><p><b class=\"u-bold\">Sock-Like Fit</b></p><p>Nike Flyknit hugs your foot for a locked-in feel and lightweight, breathable support on every run.</p><br><p><b class=\"u-bold\">Natural Movement</b></p><p>With each stride, a soft, flexible Nike Free sole expands and contracts in all directions, following the natural motion of your foot.</p><br><p><b class=\"u-bold\">Secure Fit</b></p><p>Flywire cables connect with the laces, giving you a locked-in fit throughout long races or quick sprints.</p><br><p><b class=\"u-bold\">More Details</b></p><li>A unique channel on the sole helps to smooth out your footstrike</li><li>Rubber sections on the toe and heel of the sole offer traction and durability</li><li>Structured heel helps hold your foot in place</li><li>Shown: Blue Fox/Wolf Grey/White/Pure Platinum</li><li>Style: 881973-402</li><br><p><b class=\"u-bold\">Nike Free Origins</b></p><p>After learning that Stanford athletes had been training barefoot on the university\'s golf course, three of Nike\'s most innovative and creative employees set out to develop a shoe that felt natural and weightless, similar to bare feet. The team spent eight years studying the biomechanics of runners\' feet in motion. The results yielded a profound understanding of the foot\'s natural landing angle, pressure and toe position, allowing Nike designers to build an unconventional and flexible running shoe from the inside out.</p><br><p><b class=\"u-bold\">Flyknit Origins</b></p>Nike Flyknit technology was inspired by feedback from runners seeking a shoe with the snug (and virtually unnoticed) fit of a sock. Nike embarked on a four-year mission with teams of programmers, engineers and designers to create the technology needed to make the knit upper with static properties for structure and durability. Then the precise placement of support, flexibility and breathability—all in one layer—was refined. The result is a featherweight, formfitting and virtually seamless upper. This unprecedented precision maximizes performance while reducing the material waste of traditional cut and sew by an average of 60%. The equivalent of six recycled plastic bottles are used in every pair of Flyknit shoes, saving millions of pounds of material from reaching landfills.', '100', 201802, '2018-05-12 06:19:30', '2018-05-11 23:19:30'),
(1105180085, 'Nike Star Runner', '<p><b class=\"u-bold\">EASY COMFORT</b></p><br><p>The Nike Star Runner Little Kids\' Shoe delivers low-top comfort and lightweight cushioning with a simple hook-and-loop strap for easy on and off.</p><br><p><b class=\"u-bold\">Benefits</b></p><li>Stretch fabric and leather construction for a natural, lasting fit</li><li>Hook-and-loop strap for easy on and off</li><li>Foam cushioning provides lightweight comfort</li><li>Rubber outsole for durable support</li><li>Shown: Thunder Blue/White/Obsidian/Volt</li><li>Style: 921443-404</li>', '48', 201802, '2018-05-12 06:19:30', '2018-05-11 23:19:30'),
(1105180086, 'Nike Air Max Sequent 3', '<p><b class=\"u-bold\">MAXED-OUT COMFORT</b></p><br><p>The Nike Air Max Sequent Little Kids\' Shoe combines a Max Air unit in the heel, soft foam cushioning and grooves on the sole for plush, all-day comfort.&nbsp;</p><br><p><b class=\"u-bold\">Benefits</b></p><li>Breathable mesh for comfortable support</li><li>Max Air cushioning in the heel for soft steps</li><li>Foam cushioning provides all-day comfort</li><li>Grooves along the sole let little feet flex naturally</li><li>Rubber sections in high-wear areas enhance durability</li><li>Shown: Team Red/Total Crimson/White/Black</li><li>Style: AO0554-600</li><br><p><b class=\"u-bold\">NIKE AIR MAX ORIGINS</b></p>Nike\'s revolutionary Air-Sole unit made its way into Nike footwear in 1978. In 1987, the Nike Air Max 1 debuted with visible air in its heel, allowing fans more than just the feel of Air-Sole comfort—suddenly they could see it. Since then, next-generation Nike Air Max shoes have become a hit with athletes and collectors by offering striking color combinations and reliable, lightweight cushioning.', '70', 201802, '2018-05-12 06:19:30', '2018-05-11 23:19:30'),
(1105180087, 'Nike Zoom Pegasus 34', '<p><b class=\"u-bold\">FASTER THAN EVER</b></p><br><p>The Nike Air Zoom Pegasus 34 Big Kids\' Running Shoe combines springy cushioning with a locked-in fit to help you stay quick and comfortable during everyday runs or demanding races.</p><br><p><b class=\"u-bold\">Responsive Cushioning</b></p><p>A Nike Zoom Air unit in the heel delivers springy cushioning to help you fly past the finish line.</p><br><p><b class=\"u-bold\">Secure Fit</b></p><p>Lightweight, breathable mesh with Flywire cables offers a snug fit that adapts to your foot\'s natural movements.</p><br><p><b class=\"u-bold\">Smooth Ride</b></p><p>A unique channel on the sole helps to smooth out your footstrike for a stable ride on the track, trail or street.</p><br><p><b class=\"u-bold\">More Details</b></p><li>Premium foam cushioning offers lasting comfort and support</li><li>No-sew toe overlay for durability</li><li>Flex grooves let your foot move naturally</li><li>Waffle-inspired rubber sole for durable traction</li><li>Shown: Noise Aqua/Bleached Aqua/Green Abyss/White</li><li>Style: 881954-404</li>', '90', 201802, '2018-05-12 06:19:30', '2018-05-11 23:19:30'),
(1105180088, 'Nike Free RN 2018', '<p><b class=\"u-bold\">LIGHTWEIGHT FLEXIBILITY</b></p><br><p>The&nbsp;Nike Free RN 2018 Infant/Toddler Shoe combines lightweight breathability with the classic cushioning and flexibility&nbsp;of a Nike Free midsole. A hook-and-loop strap and slip-on design makes the shoe easy for you to put on their foot and take off.</p><br><p><b class=\"u-bold\">Benefits</b></p><li>Textile upper for snug comfort and support</li><li>Hook-and-loop strap for easy on and off</li><li>Nike Free midsole provides flexible, all-day comfort</li><li>Padded collar cushions the ankle</li><li>Stretchy heel piece provides heel-to-ankle support</li><li>Flex grooves let the foot bend naturally</li><li>Shown: Team Royal/Photo Blue/White</li><li>Style: AH3453-401</li><br><p><b class=\"u-bold\">Nike Free Origins </b></p><p>After learning that Stanford athletes had been training barefoot, three of Nike\'s most innovative and creative employees set out to develop a shoe that felt natural and weightless, similar to bare feet. The team spent four years studying the biomechanics of runners\' feet in motion. The results yielded a profound understanding of the foot\'s natural landing angle, pressure and toe position, allowing Nike designers to build an unconventional and flexible running shoe from the inside out.</p><br>', '48', 201802, '2018-05-12 06:19:30', '2018-05-11 23:19:30'),
(1105180061, 'Nike SB Air Max Bruin Vapor', '<p><b class=\"u-bold\">CLASSIC LOOK, PREMIUM PERFORMANCE.</b></p><br><p>The Nike SB Air Max Bruin Vapor Big Kids\' Skateboarding Shoe takes the old-school basketball shoe and updates it with a Nike Air Max unit that gives you extra cushioning on your next big trick.</p><br><p><b class=\"u-bold\">Benefits</b></p><li>Max Air cushioning provides comfort upon impact</li><li>Suede for durability</li><li>An interior sleeve gives a sock-like fit</li><li>Shown: Black/White</li><li>Style: 922867-002</li>', '85', 201806, '2018-05-12 06:21:35', '2018-05-11 23:21:35'),
(1105180062, 'Nike SB Portmore II Ultralight', '<p><b class=\"u-bold\">PREMIUM, LIGHTWEIGHT BOARDFEEL.</b></p><br><p>The Nike SB Portmore II Ultralight Big Kids\' Skateboarding Shoe is lightweight and breathable. It combines flexible cushioning with grippy traction for excellent boardfeel, wherever you skate.</p><br><p><b class=\"u-bold\">Benefits</b></p><li>Textile upper is ultra-lightweight and breathable</li><li>Inner sleeve provides snug, sock-like comfort</li><li>Foam cushioning for all-day comfort</li><li>Rubber sole with Herringbone patterns grips the board</li><li>Shown: Dark Grey/Pure Platinum/Pure Platinum/Summit White</li><li>Style: 905211-006</li>', '55', 201806, '2018-05-12 06:21:35', '2018-05-11 23:21:35'),
(1105180063, 'Nike Zoom Stefan Janoski', '<p><b class=\"u-bold\">MAXIMUM BOARDFEEL AND DURABILITY</b></p><br><p>The Nike SB Zoom Stefan Janoski Big Kids\'&nbsp;Skateboarding Shoe was designed in collaboration with the skate legend. Built for daily use, it delivers durability, grip and excellent boardfeel.</p><br><p><b class=\"u-bold\">Boardfeel </b></p><p>A drop-in sockliner with Nike Zoom Air in the heel provides cushioning on impact, while a low-profile vulcanized rubber sole gives you the boardfeel you need for any style of skating.</p><br><p><b class=\"u-bold\">Fit </b></p><p>Comfortable, durable suede from toe to heel helps prevent blowouts so you can skate longer. Perforations in the toe help keep air flowing.</p><br><p><b class=\"u-bold\">Janoski Origins </b></p>Back in ‘09, most skate shoes were&nbsp;breadloafs. Nike SB pro Stefan Janoski set out to break the mold. He wanted his signature shoe to be flatter, lighter and lower, so he could feel everything underfoot. “Make my feet bleed,” he told us. We gave him a super-thin vulcanized sole and a collar so low it needed that iconic heel band to stay in place. We also gave him responsive Nike Zoom Air to keep his feet from bleeding for real. The result showed Stefan’s no-nonsense personality in every detail—right down to&nbsp;the motto&nbsp;on his old-school patch.', '65', 201806, '2018-05-12 06:21:35', '2018-05-11 23:21:35'),
(1105180064, 'Nike SB Stefan Janoski', '<p><b class=\"u-bold\">TRUE TO THE ORIGINAL</b></p><br><p>The&nbsp;Nike SB Stefan Janoski Infant/Toddler Kids\' Shoe pairs the minimal look and flexibility of a classic low-top skate shoe with an alternative hook-and-loop closure for quick on and off.</p><br><p><b class=\"u-bold\">Benefits</b></p><li>Suede upper with minimal stitching for durability&nbsp;</li><li>Hook-and-loop closure for easy on and off</li><li>Tacky rubber sole for traction and stability</li><li>Shown: Black/White</li><li>Style: 705404-001</li>', '50', 201806, '2018-05-12 06:21:35', '2018-05-11 23:21:35'),
(1105180065, 'Nike SB Check Canvas', '<p><b class=\"u-bold\">CUSHIONED COMFORT</b></p><br><p>The Nike SB Check Canvas Big Kids\' Skateboarding Shoe provides comfort on and off your board. Extra durability on the outer forefoot area helps protect against abrasion for&nbsp;the&nbsp;ollie.</p><br><p><b class=\"u-bold\">Benefits</b></p><li>Canvas upper and padded tongue for comfort</li><li>Reinforced area on outer forefoot for enhanced durability</li><li>Foam socklliner for cushioning</li><li>Rubber outsole offers superior grip</li><li>Shown: Black/White</li><li>Style: 905373-003</li>', '55', 201806, '2018-05-12 06:21:35', '2018-05-11 23:21:35'),
(1105180066, 'Nike SB Stefan Janoski Canvas Slip-on', '<p><b class=\"u-bold\">LIGHTWEIGHT, ALL-DAY COMFORT.</b></p><br><p>The Nike SB Stefan Janoski Canvas Slip-On Little Kids\' Skateboarding Shoe&nbsp;features soft foam cushioning for comfort with every step. Its slip-on design makes it easy to get on and off quickly.</p><br><p><b class=\"u-bold\">Benefits</b></p><li>Canvas offers lightweight comfort</li><li>Foam insole for cushioning and boardfeel</li><li>Stretch tongue gussets for a snug fit and easy on and off</li><li>Autoclave construction for a streamlined look and feel</li><li>Rubber outsole with herringbone pattern offers superior grip</li><li>Shown: Black/White/Light Bone</li><li>Style: 882989-006</li>', '55', 201806, '2018-05-12 06:21:35', '2018-05-11 23:21:35'),
(1105180067, 'Nike Stefan Janoski Max', '<p><b class=\"u-bold\">LEGENDARY LOOK. EVERYDAY CUSHIONING.</b></p><br><p>A skateboarding legend meets a sportswear icon in the Nike Stefan Janoski Max Little Kids\' Shoe. A textile upper provides breathable comfort, and visible Max Air in the heel supports and cushions little feet.&nbsp;</p><br><p><b class=\"u-bold\">Benefits</b></p><li>Textile upper for breathable comfort</li><li>Foam sockliner for lightweight cushioning</li><li>Rubber outsole for traction and stability</li><li>Low-profile foam and Max Air in the heel provide lightweight cushioning</li><li>Deep flex grooves allow their foot to bend naturally</li><li>Shown: Black/Medium Olive/Gum Light Brown/White</li><li>Style: 943824-006</li>', '75', 201806, '2018-05-12 06:21:35', '2018-05-11 23:21:35'),
(1105180068, 'Nike SB Stefan Janoski Max', '<p><b class=\"u-bold\">ICONIC LOOK. ALL-DAY COMFORT.</b></p><br><p>The Nike SB Stefan Janoski MaxBig Kids\' Skateboarding Shoe offers plush cushioning at the heel and flexibility at the toe for all-day comfort, on or off your board.</p><br><p><b class=\"u-bold\">Timeless Design </b></p><p>The Janoski’s unique profile combines with the Air Max’s iconic look for a shoe that’s versatile enough to wear all day long.</p><br><p><b class=\"u-bold\">Maximum Comfort</b></p><p>Plush foam and visible Air Max cushioning help keep you comfortable, while deep grooves in the sole let your foot flex naturally.</p><br><p><b class=\"u-bold\">Lightweight Breathability</b></p>Breathable textile gives you a lightweight fit and feel for wherever the day takes you', '85', 201806, '2018-05-12 06:21:35', '2018-05-11 23:21:35'),
(1105180051, 'Nike Vapor Ultrafly Keystone (Wide)', '', '30', 201807, '2018-05-12 06:21:58', '2018-05-11 23:21:58'),
(1105180052, 'Nike Alpha Huarache Keystone Mid', '', '40', 201807, '2018-05-12 06:21:58', '2018-05-11 23:21:58'),
(1105180053, 'Nike Force Air Trout 4 Pro MCS', '', '62', 201807, '2018-05-12 06:21:58', '2018-05-11 23:21:58'),
(1105180054, 'Nike Vapor Ultrafly Keystone', '', '30', 201807, '2018-05-12 06:21:58', '2018-05-11 23:21:58'),
(1105180055, 'Nike Force Trout 4 Keystone', '', '40', 201807, '2018-05-12 06:21:58', '2018-05-11 23:21:58'),
(1105180031, 'LeBron Soldier XII', '<p><b class=\"u-bold\">FRONT-LINE PERFORMANCE</b></p><br><p>The LeBron Soldier XII Big Kids\'&nbsp;Basketball Shoe delivers lightweight, responsive comfort on the court with Nike Zoom Air cushioning. Adjustable hook-and-loop straps offer personalized, secure lockdown for every cut and drive.</p><br><p><b class=\"u-bold\">Benefits</b></p><li>Textile and synthetic construction offers comfortable support</li><li>Adjustable straps cross the midfoot and ankle for locked-in support</li><li>Foam midsole with Nike Zoom Air for responsive cushioning</li><li>Durable rubber tread delivers excellent traction</li><li>Shown: White/Multi-Color</li><li>Style: AA1352-100</li>', '120', 201801, '2018-05-12 06:22:22', '2018-05-11 23:22:22'),
(1105180032, 'LeBron 15', '<p><b class=\"u-bold\">FOR THE UNBREAKABLE</b></p><br><p>The LeBron 15 Big Kids\' Basketball Shoe features a new kind of Flyknit and a powerful combination of cushioning designed to meet the demands of explosive players like LeBron.</p><br><p><b class=\"u-bold\">Locked-in Support</b></p><p>Brand-new BattleKnit—a type of Flyknit material designed specifically for LeBron—delivers stretchy support, ultra-lightweight flexibility, and a locked-in feel.</p><br><p><b class=\"u-bold\">Exceptionally Responsive Cushioning</b></p><p>This is the first time both Nike Zoom Air and Max Air have been used in a basketball shoe. The combination helps soften hard landings and enable quick moves for powerful players.</p><br><p><b class=\"u-bold\">Seamless Fit</b></p><p>A full inner-sleeve offers a secure, sock-like fit. And a high-stretch collar provides flexible support around your ankle. The collar also lets you get the shoe on and off easily.</p><br><p><b class=\"u-bold\">More Details</b></p><li>Ultralight, strong Flywire cables add support</li><li>Foam midsole provides lightweight, resilient cushioning</li><li>Rubber outsole offers durable, multi-surface traction</li><li>Shown: Multi-Color/Black</li><li>Style: 922811-901</li>', '160', 201801, '2018-05-12 06:22:22', '2018-05-11 23:22:22'),
(1105180033, 'LeBron Soldier XI FlyEase', '<p><b class=\"u-bold\">SUPERCHARGE EVERY STEP</b></p><br><p>The LeBron Soldier XI FlyEase Big Kids\' Basketball Shoe wraps your foot in soft, breathable mesh and locks it down with an innovative FlyEase.</p><br><p><b class=\"u-bold\">Secure Fit</b></p><p>A FlyEase closure system connects with the four hook-and-loop straps for secure lockdown and the ability to open and close the shoe – heel and all – in one fluid motion.</p><br><p><b class=\"u-bold\">Responsive Cushioning</b></p><p>Lightweight Nike Zoom Air cushioning delivers the responsiveness required for energetic drives and soft landings.</p><br><p><b class=\"u-bold\">More Details</b></p><li>Soft foam molded around the ankle for exceptional comfort</li><li>Flex grooves let the shoe flex naturally with your foot</li><li>Foam midsole for lightweight cushioning</li><li>Rubber sole provides durable, multi-surface traction</li><li>Shown: Neutral Olive/Sequoia/Hyper Crimson/Neutral Olive</li><li>Style: AJ6985-200</li>', '110', 201801, '2018-05-12 06:22:22', '2018-05-11 23:22:22'),
(1105180034, 'Kyrie 4', '<p><b class=\"u-bold\">FIND YOUR GROOVE</b></p><br><p>The Kyrie 4 Big Kids\' Basketball Shoe is ultra-flexible, responsive and supportive. It\'s designed for Kyrie Irving\'s sudden changes of direction and smooth yet rapid playing style.</p><br><p><b class=\"u-bold\">Flexible Traction </b></p><p>The Flex Groove outsole has a zigzag cutout along the bottom for excellent flexibility and traction. The sides of the sole are curved to enable smooth transitions and fast, fluid play.</p><br><p><b class=\"u-bold\">Responsive Cushioning</b></p><p>Underfoot is lightweight foam cushioning that provides soft comfort and great court feel with every move.</p><br><p><b class=\"u-bold\">Breathable Support </b></p><p>Through the forefoot, mesh keeps air flowing to help your feet stay cool. And ultralight, super-strong Flywire cables provide support during sharp cuts.</p><br><p><b class=\"u-bold\">More Details</b></p><li>Layered upper for durability</li><li>Kyrie-inspired details on the tongue</li><li>Shown: White/Multi-Color</li><li>Style: AA2897-104</li>', '100', 201801, '2018-05-12 06:22:22', '2018-05-11 23:22:22'),
(1105180035, 'Kyrie 4 Mamba', '<p><b class=\"u-bold\">DYNAMIC SUPPORT</b></p><br><p>The Kyrie 4 Mamba Big Kids\' Basketball Shoe is made for the quickest cuts and dynamic play with a lightweight upper and soft foam cushioning.</p><br><p><b class=\"u-bold\">Benefits</b></p><li>Flywire cables provide secure lockdown</li><li>Fabric and textile upper offer lightweight support</li><li>Foam midsole for lightweight cushioning</li><li>Rubber outsole provides secure traction</li><li>Shown: Black/Purple Venom/Sonic Yellow</li><li>Style: AV3597-001</li>', '100', 201801, '2018-05-12 06:22:22', '2018-05-11 23:22:22'),
(1105180036, 'PG 2', '<p><b class=\"u-bold\">LIGHTWEIGHT COMFORT AND SUPPORT</b></p><br><p>The PG 2 Big Kids\' Basketball Shoe is designed for the players who compete and play their hardest on both sides of the court. It\'s light yet strong, with a supportive strap and comfortable cushioning designed to the specification of NBA player Paul George.&nbsp;</p><br><p><b class=\"u-bold\">Lightweight Cushioning </b></p><p>Ultra-soft foam runs the length of your foot for soft, responsive cushioning on jumps and hard cuts. Extra foam at the heel and forefoot enhances support when you\'re moving side to side.</p><br><p><b class=\"u-bold\">Locked-in Stability </b></p><p>A forefoot strap provides the stability you need to move smoothly in any direction.</p><br><p><b class=\"u-bold\">Great Traction</b></p><p>A full-length&nbsp;rubber outsole with flex grooves along the bottom help with traction and movement in any direction.&nbsp;</p><br><p><b class=\"u-bold\">More Details</b></p><li>Textile and synthetic upper for durability</li><li>Rubber outsole for traction&nbsp;</li><li>Flex grooves for natural motions</li><li>Signature PG details on the midsole</li><li>Shown: Dark Obsidian/Kinetic Green/Navy</li><li>Style: 943820-400</li>', '90', 201801, '2018-05-12 06:22:22', '2018-05-11 23:22:22'),
(1105180037, 'Nike Zoom KDX LE', '<p><b class=\"u-bold\">DYNAMIC, LOCKED-IN COMFORT</b></p><br><p>With on-demand support and ultra-responsive cushioning that outperforms wherever you play, the Nike Zoom KDX LE Big Kids\' Basketball Shoe is as versatile as KD himself.</p><br><p><b class=\"u-bold\">LIGHTWEIGHT RESPONSIVENESS</b></p><p>Nike Zoom Air cushioning responds to the court beneath you to help you feel light and comfortable on your feet.</p><br><p><b class=\"u-bold\">LOCKED-IN COMFORT</b></p><p>Zoned Flyknit fabric integrates areas of lightweight breathability, stretch and support for cik-like comfort and locked-in feel.</p><br><p><b class=\"u-bold\">ON-DEMAND SUPPORT</b></p><p>Oversize laces wrap the sides of your foot to provide comfortable support when and where you need it.</p><br><p><b class=\"u-bold\">MORE DETAILS</b></p><li>Rubber sole with multidirectional traction for durability and grip</li><li>Heel and tongue pull tabs for easy on and off</li><li>Shown: Black/University Red/Metallic Gold</li><li>Style: AJ7220-076</li>', '125', 201801, '2018-05-12 06:22:22', '2018-05-11 23:22:22'),
(1105180038, 'Nike Team Hustle D 8', '<p><b class=\"u-bold\">BREATHABLE AND FAST</b></p><br><p>The Nike Team Hustle D 8 Little Kids\' Basketball Shoe features perforated panels and&nbsp;deep flex grooves to help keep you&nbsp;cool and moving naturally on the court.&nbsp;&nbsp;</p><br><p><b class=\"u-bold\">Benefits</b></p><li>Leather and mesh construction for breathable support</li><li>Midfoot strap provides a locked-in fit</li><li>Flexible foam for lightweight cushioning</li><li>Thin rubber outsole for durable traction</li><li>Flex grooves allow natural movement</li><li>Perforations enhance airflow</li><li>Shown: White/Black</li><li>Style: 881942-100</li>', '55', 201801, '2018-05-12 06:22:22', '2018-05-11 23:22:22'),
(1105180039, 'Nike Team Hustle Quick', '<p><b class=\"u-bold\">HOOPS-INSPIRED SUPPORT</b></p><br><p>With a combination of leather and mesh, the Nike Team Hustle Quick Little Kids\' Shoe delivers durable support and all-day comfort.</p><br><p><b class=\"u-bold\">Benefits</b></p><li>Leather and mesh combine for lightweight durability and support</li><li>Reinforced stitching enhances stability</li><li>Flex grooves along the sole let your foot flex naturally</li><li>Low-top design lets your ankle move naturally</li><li>Shown: Game Royal/Black/White</li><li>Style: 922681-400</li>', '50', 201801, '2018-05-12 06:22:22', '2018-05-11 23:22:22'),
(1105180040, 'Nike Zoom KDX', '<p><b class=\"u-bold\">DYNAMIC, LOCKED-IN COMFORT</b></p><br><p>With on-demand support and ultra-responsive cushioning that outperforms wherever you play, the Nike Zoom KDX Big Kids\' Basketball Shoe is as versatile as KD himself.</p><br><p><b class=\"u-bold\">Lightweight Responsiveness</b></p><p>Nike Zoom Air cushioning responds to the court beneath you to help you feel light and comfortable on your feet.</p><br><p><b class=\"u-bold\">On-Demand Support</b></p><p>Oversize laces wrap the sides of your foot to provide comfortable support when and where you need it.</p><br><p><b class=\"u-bold\">More Details</b></p><li>Rubber sole with multidirectional traction for durability and grip</li><li>Heel and tongue pull tabs for easy on and off</li><li>Shown: Racer Blue/Black/Total Crimson/Light Menta</li><li>Style: 918365-402</li><p><br><br></p>', '125', 201801, '2018-05-12 06:22:22', '2018-05-11 23:22:22'),
(1105180021, 'Nike Jr. Hypervenom Phantom III Academy Dynamic Fit FG', '<p><b class=\"u-bold\">DEADLY FINISHING</b></p><br><p>The Nike Jr. Hypervenom Phantom III Academy Little/Big Kids\' Firm-Ground Soccer Cleat is designed for opportunistic goal scorers. It&nbsp;features durable, sock-like comfort and an expanded strike zone for deadly finishing.</p><br><p><b class=\"u-bold\">Benefits</b></p><li>Dynamic Fit collar wraps your ankle for sock-like comfort</li><li>Allover texture across the upper enhances touch and durability</li><li>Asymmetrical lacing creates an expanded strike zone</li><li>Removable foam sockliner provides lightweight cushioning</li><li>Lightweight cables interact with the laces to lock down your foot when moving side to side</li><li>Firm-ground (FG) cleats for use on short-grass fields</li><li>Shown: Black/Metallic Vivid Gold</li><li>Style: AH7287-090</li>', '70', 201804, '2018-05-12 06:22:43', '2018-05-11 23:22:43'),
(1105180022, 'Nike Jr. Mercurial Superfly 360 Elite CR7 FG', '<p><b class=\"u-bold\">BORN LEADER</b></p><br><p>The&nbsp;Nike Jr. Mercurial Superfly 360 Elite CR7 Big Kids\' Firm-Ground Soccer Cleat wraps your foot for a perfect fit and exceptional ball touch, while the forefoot plate provides explosive acceleration on the field.</p><br><p><b class=\"u-bold\">Benefits</b></p><li>Foot-hugging Flyknit is snug, lightweight and breathable</li><li>Revolutionary forefoot plate delivers traction exactly where you need it.</li><li>Plush sockliner provides low-profile cushioning</li><li>Firm-ground (FG) cleats for use on short-grass fields</li><li>Shown: Clear Jade/Black/Hyper Turquoise/Metallic Vivid Gold</li><li>Style: AJ3086-390</li><br><p><b class=\"u-bold\">Flyknit Origins </b></p><p>Nike Flyknit technology was inspired by feedback from runners seeking a shoe with the snug (and virtually unnoticed) fit of a sock. Nike embarked on a four-year mission with teams of programmers, engineers and designers to create the technology needed to make the knit upper with static properties for structure and durability. Then the precise placement of support, flexibility and breathability—all in one layer—was refined. The result is a featherweight, formfitting and virtually seamless upper. This unprecedented precision maximizes performance while reducing the material waste of traditional cut and sew by an average of 60%. The equivalent of six recycled plastic bottles are used in every pair of Flyknit shoes, saving millions of pounds of material from reaching landfills.</p><br>', '185', 201804, '2018-05-12 06:22:43', '2018-05-11 23:22:43'),
(1105180023, 'Nike Jr. Superfly VI Academy CR7 MG', '<p><b class=\"u-bold\">BORN LEADER</b></p><br><p>The Nike Jr. Superfly VI Academy CR7 MG Little/Big Kids\' Multi-Ground Soccer Cleat features a low-profile Dynamic Fit collar and micro-textured upper for sock-like comfort and precise touch. A mixture of two different studs provide great traction on natural and artificial grass.</p><br><p><b class=\"u-bold\">Benefits</b></p><li>Low-profile Dynamic Fit collar fits snugly around your ankle for a sock-like feel</li><li>Micro-texture on the upper provides precise touch at high speeds</li><li>Textile and synthetic upper with sculpted arch provides comfortable support</li><li>Thin sockliner provides lightweight cushioning</li><li>Outsole wraps up the toe for added durability</li><li>Multi-ground (MG) cleats for use on short-grass or artificial surfaces</li><li>Shown: Clear Jade/Black/Hyper Turquoise/Metallic Vivid Gold</li><li>Style: AJ3111-390</li>', '75', 201804, '2018-05-12 06:22:43', '2018-05-11 23:22:43'),
(1105180024, 'Nike Jr. MercurialX Superfly VI Academy CR7', '<p><b class=\"u-bold\">BORN LEADER</b></p><br><p>The&nbsp;Nike Jr. MercurialX Superfly VI Academy CR7 Little/Big Kids\' Indoor/Court Soccer Shoe provides exceptional ball touch and comfortable, secure support that promotes acceleration and quick directional changes on the court.</p><br><p><b class=\"u-bold\">Benefits</b></p><li>Synthetic construction for comfortable support</li><li>Sockliner for lightweight cushioning to reduce cleat pressure</li><li>Indoor/Court (IC) outsole for traction on the street, court and indoor surfaces</li><li>Non-marking outsole</li><li>Shown: Clear Jade/Black/Hyper Turquoise/Metallic Vivid Gold</li><li>Style: AJ3110-390</li>', '75', 201804, '2018-05-12 06:22:43', '2018-05-11 23:22:43'),
(1105180025, 'Nike. Jr. Mercurial Superfly VI Club CR7 MG', '<p><b class=\"u-bold\">BORN LEADER</b></p><br><p>The Nike Jr. Superfly VI Club CR7 MG Little/Big Kids\' Multi-Ground Soccer Cleat features a low-profile Dynamic Fit collar and a synthetic upper that delivers precise touch. A mixture of two different studs on the outsole provide great traction on natural and artificial grass.</p><br><p><b class=\"u-bold\">Benefits</b></p><li>Low-profile Dynamic Fit collar fits snugly around your ankle for a sock-like feel</li><li>Textile and synthetic upper with sculpted arch provides comfortable support</li><li>Thin sockliner provides lightweight cushioning</li><li>Outsole wraps up the toe for added durability</li><li>Multi-ground (MG) cleats for use on short-grass or artificial surfaces</li><li>Shown: Clear Jade/Black/Hyper Turquoise/Metallic Vivid Gold</li><li>Style: AJ3115-390</li>', '55', 201804, '2018-05-12 06:22:43', '2018-05-11 23:22:43');
INSERT INTO `products` (`id`, `name`, `description`, `price`, `category_id`, `created`, `updated`) VALUES
(1105180026, 'Nike Jr. Mercurial Superfly 360 Elite FG', '<p><b class=\"u-bold\">EXPLOSIVE SPEED</b></p><br><p>The&nbsp;Nike Jr. Mercurial Superfly 360 Elite Big Kids\' Firm-Ground Soccer Cleat wraps your foot for a perfect fit and exceptional ball touch, while the forefoot plate provides explosive acceleration on the field.</p><br><p><b class=\"u-bold\">Benefits</b></p><li>Foot-hugging Flyknit is snug, lightweight and breathable</li><li>Revolutionary forefoot plate delivers traction exactly where you need it.</li><li>Plush sockliner provides low-profile cushioning</li><li>Firm-ground (FG) cleats for use on short-grass fields</li><li>Shown: Black/White/Total Orange</li><li>Style: AH7340-081</li><br><p><b class=\"u-bold\">Flyknit Origins </b></p><p>Nike Flyknit technology was inspired by feedback from runners seeking a shoe with the snug (and virtually unnoticed) fit of a sock. Nike embarked on a four-year mission with teams of programmers, engineers and designers to create the technology needed to make the knit upper with static properties for structure and durability. Then the precise placement of support, flexibility and breathability—all in one layer—was refined. The result is a featherweight, formfitting and virtually seamless upper. This unprecedented precision maximizes performance while reducing the material waste of traditional cut and sew by an average of 60%. The equivalent of six recycled plastic bottles are used in every pair of Flyknit shoes, saving millions of pounds of material from reaching landfills.</p><br>', '175', 201804, '2018-05-12 06:22:43', '2018-05-11 23:22:43'),
(1105180027, 'Nike Jr. Mercurial Vapor XII Academy MG', '<p><b class=\"u-bold\">BORN MERCURIAL</b></p><br><p>The&nbsp;Nike Jr. Mercurial&nbsp;Vapor XII Academy Little/Big Kids\' Multi-Ground Soccer Shoe wraps your foot for comfort and exceptional ball touch. The cleated outsole delivers secure traction on multiple surfaces.</p><br><p><b class=\"u-bold\">Benefits</b></p><li>Synthetic construction offers comfortable support</li><li>Sockliner for lightweight cushioning to reduce cleat pressure</li><li>Multi-ground (MG) cleats for use on short-grass or artificial surfaces</li><li>Shown: Black/White/Total Orange</li><li>Style: AH7347-081</li>', '60', 201804, '2018-05-12 06:22:43', '2018-05-11 23:22:43'),
(1105180028, 'Nike Jr. Superfly VI Academy MG', '<p><b class=\"u-bold\">PERFORMANCE ON ANY PITCH</b></p><br><p>The Nike Jr. Superfly VI Academy MG Little/Big Kids\' Multi-Ground Soccer Cleat features a low-profile Dynamic Fit collar and micro-textured upper for sock-like comfort and precise touch. A mixture of two different studs provide great traction on natural and artificial grass.</p><br><p><b class=\"u-bold\">Benefits</b></p><li>Low-profile Dynamic Fit collar fits snugly around your ankle for a sock-like feel</li><li>Micro-texture on the upper provides precise touch at high speeds</li><li>Textile and synthetic upper with sculpted arch provides comfortable support</li><li>Thin sockliner provides lightweight cushioning</li><li>Outsole wraps up the toe for added durability</li><li>Multi-ground (MG) cleats for use on short-grass or artificial surfaces</li><li>Shown: Black/White/Total Orange</li><li>Style: AH7337-081</li>', '70', 201804, '2018-05-12 06:22:43', '2018-05-11 23:22:43'),
(1105180029, 'Nike Jr. MercurialX Superfly VI Academy', '<p><b class=\"u-bold\">BORN MERCURIAL</b></p><br><p>The&nbsp;Nike Jr. MercurialX Superfly VI Academy&nbsp;Little/Big Kids\' Indoor/Court Soccer Shoe provides exceptional ball touch and comfortable, secure support that promotes acceleration and quick directional changes on the court.</p><br><p><b class=\"u-bold\">Benefits</b></p><li>Synthetic construction for comfortable support</li><li>Sockliner for lightweight cushioning to reduce cleat pressure</li><li>Indoor/Court (IC) outsole for traction on the street, court and indoor surfaces</li><li>Non-marking outsole</li><li>Shown: Total Orange/Total Orange/Volt/White</li><li>Style: AH7343-810</li>', '60', 201804, '2018-05-12 06:22:43', '2018-05-11 23:22:43'),
(1105180030, 'Nike Jr. MercurialX Vapor XII Academy MG', '<p><b class=\"u-bold\">BORN MERCURIAL</b></p><br><p>The&nbsp;Nike Jr. MercurialX Vapor XII Academy Toddler/Little Kids\' Multi-Ground Soccer Cleat wraps your foot for snug comfort on any pitch. The cleated outsole provides durable traction and stability for little feet&nbsp;on short grass or artificial surfaces.</p><br><p><b class=\"u-bold\">Benefits</b></p><li>Synthetic construction offers comfortable support</li><li>Sockliner for lightweight cushioning to reduce cleat pressure</li><li>Multi-ground (MG) cleats for use on short-grass or artificial surfaces</li><li>Shown: Black/White/Total Orange</li><li>Style: AH7349-081</li>', '55', 201804, '2018-05-12 06:22:43', '2018-05-11 23:22:43'),
(1105180011, 'Nike Force Savage Shark', '<div class=\"pi-pdpmainbody\"><p><b class=\"u-bold\">STABILITY MEETS SPEED</b></p><br><p>The Nike Force Savage Shark Little/Big Kids\' Football Cleat features a high top for durable support. Rubber cleats deliver the traction you need to accelerate and change direction quickly.</p><br><p><b class=\"u-bold\">Benefits</b></p><li>Synthetic leather and textile for durable support</li><li>High-top design with padded collar for comfort and stability</li><li>Foam midsole provides lightweight cushioning</li><li>Rubber cleat configuration for multidirectional traction</li><li>FastFlex technology in sole promotes natural motion</li><li>Shown: Black/Wolf Grey/White/White</li><li>Style: AH6425-010</li></div>', '55', 201803, '2018-05-12 06:23:00', '2018-05-11 23:23:00'),
(1105180012, 'Nike Alpha Menace Shark', '<div class=\"pi-pdpmainbody\"><p><b class=\"u-bold\">COMFORT MEETS SPEED</b></p><br><p>The&nbsp;Nike Alpha Menace Shark Little/Big Kids\' Football Cleat features a&nbsp;synthetic construction for durable support, while rubber tread delivers the traction you need to accelerate and change direction quickly.</p><br><p><b class=\"u-bold\">Benefits</b></p><li>Synthetic construction provides durable comfort</li><li>Foam cushioning for lightweight support</li><li>Rubber outsole with aggressive cleat configuration for multidirectional traction</li><li>Shown: White/Wolf Grey/Wolf Grey/Black</li><li>Style: AH6422-100</li></div>', '40', 201803, '2018-05-12 06:23:00', '2018-05-11 23:23:00'),
(1105180013, 'Nike Vapor Untouchable Shark 3', '<div class=\"pi-pdpmainbody\"><p><b class=\"u-bold\">GAME-READY FLEXIBILITY AND CUSHIONING</b></p><br><p>The Nike Vapor Untouchable Shark 3 Little/Big Kids\' Football Cleat is made with an aggressive&nbsp;cleat configuration and a flexible outsole for rapid acceleration and quick direction changes on the field. Soft foam cushions&nbsp;your foot for game-long comfort.</p><br><p><b class=\"u-bold\">Benefits</b></p><li>Nike Fast Flex outsole bends with your foot for natural movement</li><li>Synthetic leather and textile construction for support and durability</li><li>Low-top design promotes natural range of motion</li><li>Cushioned collar for comfortable ankle support</li><li>Foam cushioning delivers premium comfort</li><li>Rubber cleats provide aggressive traction</li><li>Shown: Game Royal/White/Wolf Grey/White</li><li>Style: AH8220-411</li></div>', '38', 201803, '2018-05-12 06:23:00', '2018-05-11 23:23:00'),
(1105180015, 'Nike Alpha Menace Varsity Mid', '<div class=\"pi-pdpmainbody\"><p><b class=\"u-bold\">SUPPORTIVE COMFORT. AGGRESSIVE TRACTION.</b></p><br><p>The Nike Alpha Menace Varsity Mid Little/Big Kids\' Football Cleat&nbsp;features lightweight synthetic construction for durable support, while conical and pyramid cleats deliver the traction you need to accelerate and change direction quickly.</p><br><p><b class=\"u-bold\">Benefits</b></p><li>Lightweight synthetic construction for durable comfort</li><li>Mid-height collar offers ankle support and a snug fit</li><li>Phylon foam provides lightweight cushioning</li><li>Molded plastic plate with aggressive cleat configuration for durable traction</li><li>Shown: White/Metallic Silver/Wolf Grey/Black</li><li>Style: 880136-104</li></div>', '65', 201803, '2018-05-12 06:23:00', '2018-05-11 23:23:00'),
(1105180016, 'Nike Vapor Shark 2', '<div class=\"pi-pdpmainbody\"><p><b class=\"u-bold\">UNLEASH YOUR POWER</b></p><br><p>The&nbsp;Nike Vapor Shark 2 Little/Big Kids\' Football Cleat is made with an aggressive cleat configuration and Fast Flex technology for rapid acceleration and lightning-quick changes of direction during play.</p><br><p><b class=\"u-bold\">Benefits</b></p><li>Strategically placed cleats move with Nike Fast Flex technology</li><li>Full-length Phylon midsole offers responsive cushioning</li><li>Synthetic leather upper offers a lightweight feel</li><li>Shown: White/Wolf Grey/Multi-Color</li><li>Style: 833388-192</li></div>', '35', 201803, '2018-05-12 06:23:00', '2018-05-11 23:23:00'),
(1105180017, 'Nike Alpha Menace Shark (Wide)', '<div class=\"pi-pdpmainbody\"><p><b class=\"u-bold\">COMFORT MEETS SPEED</b></p><br><p>The&nbsp;Nike Alpha Menace Shark Little/Big Kids\' Football Cleat features a&nbsp;synthetic and textile upper for durable support, while a rubber tread delivers the traction you need to accelerate and change direction quickly.</p><br><p><b class=\"u-bold\">Benefits</b></p><li>Synthetic and textile upper for durable comfort</li><li>Foam cushioning for lightweight support</li><li>Rubber outsole with aggressive cleat configuration for multidirectional traction</li><li>Shown: Black/White/White</li><li>Style: 902510-011</li></div>', '40', 201803, '2018-05-12 06:23:00', '2018-05-11 23:23:00'),
(1105180018, 'Nike Vapor Shark 3', '<div class=\"pi-pdpmainbody\"><p><b class=\"u-bold\">FASTER CUTS, PREMIUM COMFORT.</b></p><br><p>The Nike Vapor Shark 3 Little/Big Kids\' Football Cleat is made with an speed-first cleat configuration and Fast Flex technology for rapid acceleration and lightning-quick changes of direction. Full-length foam cushions your foot for comfort throughout the game.&nbsp;</p><br><p><b class=\"u-bold\">Benefits</b></p><li>Strategically placed cleats move with Nike Fast Flex technology</li><li>Synthetic leather for support and durability</li><li>Full-length foam cushioning for premium comfort</li><li>Low-top design for a natural range of motion</li><li>Cushioned collar for comfortable ankle support</li><li>Shown: White/Total Orange/Black</li><li>Style: 917171-109</li></div>', '38', 201803, '2018-05-12 06:23:00', '2018-05-11 23:23:00'),
(1105180001, 'Nike Air Max 270', '<div class=\"pi-pdpmainbody\"><p><b class=\"u-bold\">BIG AIR</b></p><br><p>The&nbsp;Nike Air Max 270 Big Kids\' Shoe is inspired by two icons of Air: the Air Max 180 and Air Max 93. It features Nike\'s biggest heel Air unit yet for a super-soft ride that feels as impossible as it looks.</p><br><p><b class=\"u-bold\">FLEXIBLE AND BREATHABLE</b></p><p>The shoe\'s bootie construction feels snug and flexes with your foot. It\'s made with solid and mesh areas, giving you structure and ventilation where you need them most.</p><br><p><b class=\"u-bold\">SUPER-SOFT CUSHIONING</b></p><p>A dual-density foam sole and large Max Air heel unit deliver plush cushioning for casual, everyday comfort.</p><br><p><b class=\"u-bold\">MORE DETAILS</b></p><p><br></p><li>Mesh and synthetic upper for comfort and support</li><li>Flex grooves in the sole let your foot bend naturally</li><li>Asymmetrical lacing for a secure fit</li><li>Plastic heel counter stabilizes your foot</li><li>Heel pull tab for easy on and off</li><li>Solid rubber outsole at forefoot, clear rubber at heel</li><li>Shown: Racer Blue/Black/Hyper Crimson</li><li>Style: 943345-401</li><br><p></p><br><p><b class=\"u-bold\">Nike Air Max Origins</b></p><p>Nike\'s revolutionary Air-Sole unit made its way into Nike footwear in 1978. In 1987, the Nike Air Max 1 debuted with visible air in its heel, allowing fans more than just the feel of Air-Sole comfort—suddenly they could see it. Since then, next-generation Nike Air Max shoes have become a hit with athletes and collectors by offering striking color combinations and reliable, lightweight cushioning.</p><br></div>', '120', 201805, '2018-05-12 06:23:21', '2018-05-11 23:23:21'),
(1105180002, 'Nike Air Force 1 LV8', '<div class=\"pi-pdpmainbody\"><p><b class=\"u-bold\">THE HOOPS ORIGINAL, REIMAGINED.<br></b></p><br><p>The ’82 classic taken to the next level, the leather low-top Nike Air Force 1 LV8 Big Kids\' Shoe&nbsp;features premium trims and updated design details.</p><br><p><b class=\"u-bold\">Benefits</b></p><li>Genuine leather, synthetic leather or textile upper depending on color</li><li>Foam cushioning with Nike Air for lightweight comfort</li><li>Rubber sole for durability and traction</li><li>Shown: Summit White/Summit White/Summit White</li><li>Style: 820438-110</li><br><p><b class=\"u-bold\">Air Force 1 Origins </b></p>Transcending foot coverage since 1982, this once hoops shoe was named after Air Force One—the aircraft that carries the U.S. President. It was the first basketball shoe to house Nike Air, revolutionizing the game for players like Moses Malone and Charles Barkley while rapidly gaining traction around the world, from the hardwood to the blacktop to the core of hip-hop culture. Today the Air Force 1 stays true to its roots with soft, springy cushioning and a massive midsole, but the Nike Air technology takes a backseat to the shoe’s status as an icon.</div>', '85', 201805, '2018-05-12 06:23:21', '2018-05-11 23:23:21'),
(1105180003, 'Nike Air Max 95 SE', '<div class=\"pi-pdpmainbody\"><p><b class=\"u-bold\">CLASSIC DESIGN. MAXIMUM CUSHIONING.</b></p><br><p>The Nike Air Max 95 SE Big Kids\' Shoe combines supportive overlays with plush cushioning for lightweight, all-day comfort.</p><br><p><b class=\"u-bold\">Benefits</b></p><li>Visible Max Air unit in the heel for lightweight cushioning</li><li>Premium upper materials vary by color</li><li>Synthetic leather overlays for support and durability</li><li>Full-length foam cushioning for durability, stability and cushioning</li><li>Rubber outsole provides traction</li><li>Shown: Black/Summit White</li><li>Style: 922173-002</li><br><p><b class=\"u-bold\">Nike Air Max Origins</b></p><p>Nike\'s revolutionary Air-Sole unit made its way into Nike footwear in 1978. In 1987, the Nike Air Max 1 debuted with visible air in its heel, allowing fans more than just the feel of Air-Sole comfort—suddenly they could see it. Since then, next-generation Nike Air Max shoes have become a hit with athletes and collectors by offering striking color combinations and reliable, lightweight cushioning.</p><br></div>', '110', 201805, '2018-05-12 06:23:21', '2018-05-11 23:23:21'),
(1105180004, 'Nike Cortez Basic SL', '<div class=\"pi-pdpmainbody\"><p><b class=\"u-bold\">BACK TO THE BASICS</b></p><br><p>The Nike Cortez Basic SL Big Kids\' Shoe stays true to the original 1972 design. It\'s built with synthetic leather for durability and lightweight cushioning for comfort.</p><br><p><b class=\"u-bold\">Benefits</b></p><li>Synthetic leather for comfort and durability</li><li>Foam sole for lightweight cushioning</li><li>Rubber outsole with herringbone pattern for traction</li><li>Shown: White/Varsity Royal/Black/Varsity Red</li><li>Style: 904764-103</li><br><p><b class=\"u-bold\">Cortez Origins</b></p><p>The Nike Cortez was Bill Bowerman\'s first masterpiece, built to be lighter and more weatherproof than any other shoe. In 1972, it put unprecedented cushioning under the fastest feet in the running world and quickly became the most popular training shoe in the country. It was an unmistakable icon—a walking billboard that told your story and declared your affiliation—and came to thrive with fierce style on the streets of Los Angeles. Since then, no shoe has expanded the definition of a running shoe quite like the Nike Cortez.</p><br></div>', '60', 201805, '2018-05-12 06:23:21', '2018-05-11 23:23:21'),
(1105180005, 'Nike Air Max 1', '<div class=\"pi-pdpmainbody\"><p><b class=\"u-bold\">AN ICON, REBORN</b></p><br><p>The one that started it all back in 1987 is back with the Nike Air Max 1 Big Kids\' Shoe, continuing&nbsp;the tradition of cushioning you can see and feel.</p><br><p><b class=\"u-bold\">Benefits</b></p><li>Leather and synthetic leather upper for durability and support</li><li>Flexible foam Waffle midsole has strategic rubber outsole sections for traction</li><li>Visible Air-Sole unit in the heel for maximum impact protection</li><li>Low-cut collar enhances mobility around the ankle</li><li>Flex grooves for a natural ride</li><li>Shown: White/Metallic Gold/Racer Blue/White</li><li>Style: 807605-103</li><br><p><b class=\"u-bold\">Nike Air Max Origins </b></p>Nike\'s revolutionary Air-Sole unit made its way into Nike footwear in the late \'70s. In 1987, the Nike Air Max 1 debuted with visible air in its heel, allowing fans more than just the feel of Air-Sole comfort—suddenly they could see it. Since then, next-generation Nike Air Max shoes have become a hit with athletes and collectors by offering striking color combinations and reliable, lightweight cushioning.</div>', '90', 201805, '2018-05-12 06:23:21', '2018-05-11 23:23:21'),
(1105180006, 'Nike Air Force 1 LV8 UV', '<div class=\"pi-pdpmainbody\"><p><b class=\"u-bold\">LEGENDARY STYLE, ELEVATED.</b></p><br><p>The legend lives on in the Nike Air Force 1 LV8 UV&nbsp;Little Kids\' Shoe, a modern take on the icon that blends classic style and fresh, crisp details. This special edition sets itself apart with elevated design elements.</p><br><p><b class=\"u-bold\">Benefits</b></p><li>Synthetic leather and textile for supportive comfort</li><li>Encapsulated Air-Sole unit for lightweight cushioning</li><li>Rubber outsole for traction and durability</li><li>Shown: Volt/Moss/White/Black</li><li>Style: AO2287-700</li><br><p><b class=\"u-bold\">Air Force 1 Origins</b></p><p>This once hoops shoe was named after Air Force One—the aircraft that carries the U.S. President. In 1982, it was the first basketball shoe to house Nike Air, revolutionizing the game while rapidly gaining traction around the world, from the hardwood, to the blacktop, to the core of hip-hop culture. Today, the Air Force 1 stays true to its roots with soft, springy cushioning, but the Nike Air technology takes a backseat to the shoe’s status as an icon.</p><br></div>', '65', 201805, '2018-05-12 06:23:21', '2018-05-11 23:23:21'),
(1105180007, 'Nike Air Force 270', '<div class=\"pi-pdpmainbody\"><p><b class=\"u-bold\">FEEL BIG AIR</b></p><br><p>The Nike Air Force 270 Big Kids\' Shoe amps up an icon with a visible Max Air unit nearly twice the size of the 1992 original for comfort in every step.</p><br><p><b class=\"u-bold\">FLEXIBLE AND BREATHABLE</b></p><p>The shoe\'s bootie construction feels snug and flexes with your foot.</p><br><p><b class=\"u-bold\">SUPER-SOFT CUSHIONING</b></p><p>A dual-density foam sole and large Max Air heel unit deliver plush cushioning for casual, everyday comfort.</p><br><p><b class=\"u-bold\">More Details</b></p><li>Leather, fabric and textile upper for support</li><li>Midfoot strap for secure lockdown. Release with contrasting pull tab.&nbsp;</li><li>Heel pull tab for easy on and off</li><li>Solid rubber outsole at forefoot, clear rubber at heel</li><li>Shown: Medium Olive/Total Orange/Black</li><li>Style: AJ8208-200</li></div>', '145', 201805, '2018-05-12 06:23:21', '2018-05-11 23:23:21'),
(1105180008, 'Nike Air Huarache Ultra', '<div class=\"pi-pdpmainbody\"><p><b class=\"u-bold\">THE CLASSIC, LIGHTER THAN EVER.</b></p><br><p>The Nike Air Huarache Ultra&nbsp;Big Kids\' Shoe&nbsp;takes the classic to new levels of comfort with a combination midsole/outsole that drastically reduces the overall weight of the shoe.&nbsp;</p><br><p><b class=\"u-bold\">Benefits</b></p><li>Inner sleeve for snug fit</li><li>Foam sole with internal Nike Air cushioning for lightweight comfort</li><li>Molded heel piece provides a flexible, locked-in feel</li><li>Waffle outsole pattern with rubber pods for durable traction</li><li>Strategically placed rubber pods for traction and durability</li><li>Shown: White/White/White</li><li>Style: 847569-100</li></div>', '95', 201805, '2018-05-12 06:23:21', '2018-05-11 23:23:21'),
(1105180009, 'Nike Huarache City', '<div class=\"pi-pdpmainbody\"><p><b class=\"u-bold\">STRAPPED-IN COMFORT</b></p><br><p>The Nike Huarache City Big Kids\' Shoe updates the \'91 classic with crisscross straps that comfortably support your foot.</p><br><p><b class=\"u-bold\">Benefits</b></p><li>Textile, leather and synthetic leather for comfort and durability</li><li>Branded straps cross over and around the back of the heel for stability</li><li>Heel cage supports your foot and provides a classic look</li><li>Foam cushioning provides lightweight comfort</li><li>Large pull loops allow for easy on and off</li><li>Rubber pods in high-wear areas for durability</li><li>Shown: Pure Platinum/Obsidian/Kinetic Green/Blue Nebula</li><li>Style: AJ6662-001</li><br><p><b class=\"u-bold\">Air Huarache Origins</b></p>Designed by Tinker Hatfield and released in 1991, the Nike Air Huarache shook up the running world. The lining of the shoe was created to act as an exoskeleton for the athlete, molding to the shape of the foot and ankle. The shoe was such a hit that it soon found its way to basketball courts and subsequently the streets, where it earned its status as an icon.</div>', '120', 201805, '2018-05-12 06:23:21', '2018-05-11 23:23:21'),
(1105180010, 'Nike Air Max 90 Leather', '<div class=\"pi-pdpmainbody\"><p><b class=\"u-bold\">A COMFORTABLE CLASSIC</b></p><br><p>The Nike Air Max 90 Leather&nbsp;Big Kids\' Shoe features a leather upper and a visible Max Air unit in the heel for durability and outstanding cushioning.</p><br><p><b class=\"u-bold\">Benefits</b></p><li>Full-grain and synthetic leather overlays for durable support</li><li>Cushioned collar offer lasting comfort</li><li>Injected unit sole with Air Max unit in heel for lightweight cushioning</li><li>Rubber pods at outsole for traction and durability</li><li>Deep flex grooves allow natural movement</li><li>Shown: White/White</li><li>Style: 833412-100</li><br><p><b class=\"u-bold\">Nike Air Max Origins</b></p>Nike\'s revolutionary Air-Sole unit made its way into Nike footwear in the late \'70s. In 1987, the Nike Air Max 1 debuted with visible air in its heel, allowing fans more than just the feel of Air-Sole comfort—suddenly they could see it. Since then, next-generation Nike Air Max shoes have become a hit with athletes and collectors by offering striking color combinations and reliable, lightweight cushioning.</div>', '90', 201805, '2018-05-12 06:23:21', '2018-05-11 23:23:21');
